            {props.subtitle}
          </p>
        </div>
        <div className=" p-2 px-8">
          <Button
            bgBtn={"[#fff]"}
            textSize={"[14px]"}
            color={"darkGreen"}
            fontWeight={"[500]"}
            border={"border border-mint"}
            width={"[85px]"}
            m={" m-[0px]"}
            p={"p-[20px]"}
            children={"مشاهدة المزيد"}
            onClick={clickHandler}
            // icon={Send}
          />
        </div>
      </div>
    </div>
  );
}
